#import libraries

import pandas as pd
import numpy as np
from sklearn import preprocessing
import seaborn as sns
import plotly.express as px

"""### The data

The dataset that I will use contains units' attributes (static) and transactional unit's data.

Before running the next code cell to create the dataframe, the csv file provided needs to be saved in the same directory as this notebook. If using Google Colab, the file needs to be uploaded everytime the runtime environment is restarted.
"""

#data import
data=pd.read_csv('unit_transactional_data.csv')
data.head()

data.shape

"""Since the dataframe has a high number of columns, I will print a list to see all of them to decide which ones might be relevant for this analysis and which ones I can remove"""

data.columns.to_list()

cols_to_remove = [
 'name',
 'type',
 'bedrooms',
 'source_current_price',
 'blocked',
 'External_managed',
 'price',
 'sold_perc',
 'sold_perc_cum',
 'Unit_category',
 'Apartment',
]

df = data.drop(cols_to_remove, axis=1)

#check each attribute's data type and missingness
df.info()

"""All attributes with a significant amount missing of values correspond to transactional data. Since most of the units have never been reserved or sold yet, it makes sense that the records with non-null values for these attributes are a small portion of the total."""

#cast relevant dates to pandas datetime type (previously strings) to be able to make operations with them

df['sales_start'] = pd.to_datetime(df['sales_start'])
df['first_res_req'] = pd.to_datetime(df['first_res_req'])
df['first_cancelation_paid_at'] = pd.to_datetime(df['first_cancelation_paid_at'])
df['first_cancelation_req_at'] = pd.to_datetime(df['first_cancelation_req_at'])
df['first_purchase_at'] = pd.to_datetime(df['first_purchase_at'])

df.info()

"""### Reservation velocity

I will add a new column with the reservation velocity for each unit (days between the first reservation request and the sales start date).
"""

"""
Create column separtarely as a pandas NullableIntegerArray first, to be able to declare dtype.
Without declaring dtype at the creation, the Series returns exponential values (floats with large decimals)
that can't be casted to integers because of the presence of NaN values in the column.
"""

reservation_velocity = pd.Series((df['first_res_req'] - df['sales_start']).dt.days, dtype="Int64")
df['reservation_velocity'] = reservation_velocity

reservation_velocity.sort_values()

"""There are some negative `reservation_velocity` values. This means that a prospect requested to reserve a unit before the `sales_start` date.
There are scenarios in our business that would explain the existence of these cases (not going to be explained in this document), that are out of the scope of my analysis. Because these cases do not represent an impactful amount, I'll replace their values with the median of the whole column. To be able to do this, I'll replace `null` values by a distinguishable integer first.
"""

median = df['reservation_velocity'].median()
df['reservation_velocity'].replace(np.NaN, -999, inplace=True)
df['res_velocity_positive'] = np.where((df['reservation_velocity'] < 0) & (df['reservation_velocity'] > -999), median, df['reservation_velocity'])

df['res_velocity_positive'] = df['res_velocity_positive'].astype(int) #use this column instead of reservation_velocity from now on
df['res_velocity_positive'].unique()

#assign null to -999 values again, so I won't get misleading results later
df['res_velocity_positive'].replace(-999, np.NaN, inplace=True)

"""### Floor

The `floor` attribute, whose values are type object (strings), needs some manipulation. I will check the unique values to see how they all look like.
"""

df['floor'].unique()

"""I want to cast them to integers, because numerical values will show how high the floor level is, which is important for the analysis. I will convert `EG` (ground floor) values to `0`.
Furthermore, I will remove rows with `UG` (basement) and `DG` (attic) values. I will also remove `Haus` and `Pent` values, because they are special cases and should be analysed separately from normal apartments.




"""

#replace EG by 00
df['floor'] = np.where(df['floor'].str.contains('EG'), '00', df['floor'])

#remove rows with unwanted values
df = df.loc[(df['floor'] != 'DG') & (df['floor'] != 'UG') & (df['floor'] != 'Haus') & (df['floor'] != 'Pent')]

#use only the numerical values and cast them to integers
df['floor']= df['floor'].str.extract('(\d+)')
df['floor']= df['floor'].astype(int)

df['floor'].unique()

df.info()

"""## Data exploration

I believe that I am now ready to start exploring the data. I want to understand the dataset to see what information I have, what I am missing and to what extent this data can answer my questions.
"""

#generate descriptive statistics to see if I initially get something from them
df.describe()

"""### Correlation matrix

From [CFI](https://corporatefinanceinstitute.com/resources/excel/correlation-matrix/): "A correlation matrix is simply a table which displays the correlation coefficients for different variables. The matrix depicts the correlation between all the possible pairs of values in a table. It is a powerful tool to summarize a large dataset and to identify and visualize patterns in the given data". By default, pandas uses the Pearson correlation method. It assigns values between -1 and 1, where 0 means that there is no correlation, 1 means total positive correlation and -1 total negative.

In this case, I want to see how each of the attributes is related to the reservation velocity.
"""

df = df.drop([ 
 'unit_id',
 'project_id',
], axis=1)

corr = df.corr()

sns.set(rc={'figure.figsize':(11.7,8.27)})
sns.heatmap(corr, annot=True)

"""Besides the fact that the correlation matrix is not showing anything insightful enough, there is a slight difference in the correlation coefficients of `reservation_velocity` and `res_velocity_positive`. Although the difference is not too significant, I would need to look into the methods used during the data wrangling to make sure they were chosen wisely, if I was to continue the analysis in this direction.

### Different approach

Instead of using `reservation_velocity` as an indicator of the demand, I will use the unit `status`. The number of data points in this attribute is greater.
"""

#status posible values
df['status'].unique()

"""**According to our business logic:**
*   `0` = available
*   `1` = reserved
*   `2` = sold
"""

#convert to string, to pass it to plots as categorical values instead of numerical
df['status'] = df['status'].astype(str)

"""###Pick two attributes and generate one scatter plot per unit status:"""

fig = px.scatter(df, x="rooms", y="floor", facet_col="status", 
                 title="Number of rooms & floor level by unit status", 
                 labels={"rooms":"number of rooms", "floor": "floor level"})


fig.update_xaxes(showgrid=True, gridwidth=0.5, gridcolor='LightGray', dtick=1)
